import React, { useEffect } from "react";
import { gsap } from "gsap";
import { ScrollTrigger } from "gsap/ScrollTrigger";

// Import des images
import HTML from "../assets/html.png";
import CSS from "../assets/css.png";
import JavaScript from "../assets/javascript.png";
import ReactImg from "../assets/react.png";
import Node from "../assets/node.png";
import FireBase from "../assets/firebase.png";
import AWS from "../assets/aws.png";
import GitHub from "../assets/github.png";
import Tailwind from "../assets/tailwind.png";
import Mongo from "../assets/mongo.png";

gsap.registerPlugin(ScrollTrigger);

const Skills = () => {
  useEffect(() => {
    // GSAP animation pour les icônes
    gsap.from(".skill-icon", {
      opacity: 0,
      x: -100,  // Départ de l'animation depuis la gauche
      stagger: 0.3,  // Les éléments se décalent pour apparaitre un à un
      duration: 1,
      scrollTrigger: {
        trigger: ".skills-container", // Le déclencheur est la section entière
        start: "top 80%", // L'animation démarre quand la section entre dans la vue
        toggleActions: "play none none none",
      },
    });
  }, []);

  return (
    <div name="skills" className="w-full h-full bg-[#0a192f] text-gray-300">
      {/* Container */}
      <div className="max-w-[1000px] mx-auto p-4 flex flex-col justify-center w-full h-full">
        <div>
          <p className="text-4xl font-bold inline border-b-4 border-pink-600">
            Experience
          </p>
          <p className="py-4">These are the technologies I've worked with</p>
        </div>

        <div
          className="skills-container w-full grid grid-cols-2 sm:grid-cols-4 gap-4 text-center py-8"
        >
          {/* Image cards */}
          <div className="skill-icon shadow-md shadow-[#040c16] hover:scale-110 duration-500">
            <img className="w-20 mx-auto" src={HTML} alt="HTML icon" />
            <p className="my-4">HTML</p>
          </div>
          <div className="skill-icon shadow-md shadow-[#040c16] hover:scale-110 duration-500">
            <img className="w-20 mx-auto" src={CSS} alt="CSS icon" />
            <p className="my-4">CSS</p>
          </div>
          <div className="skill-icon shadow-md shadow-[#040c16] hover:scale-110 duration-500">
            <img className="w-20 mx-auto" src={JavaScript} alt="JavaScript icon" />
            <p className="my-4">JavaScript</p>
          </div>
          <div className="skill-icon shadow-md shadow-[#040c16] hover:scale-110 duration-500">
            <img className="w-20 mx-auto" src={ReactImg} alt="ReactJS icon" />
            <p className="my-4">React.JS</p>
          </div>
          <div className="skill-icon shadow-md shadow-[#040c16] hover:scale-110 duration-500">
            <img className="w-20 mx-auto" src={Node} alt="NodeJS icon" />
            <p className="my-4">Node JS</p>
          </div>
          <div className="skill-icon shadow-md shadow-[#040c16] hover:scale-110 duration-500">
            <img className="w-20 mx-auto" src={FireBase} alt="Firebase icon" />
            <p className="my-4">FireBase</p>
          </div>
          <div className="skill-icon shadow-md shadow-[#040c16] hover:scale-110 duration-500">
            <img className="w-20 mx-auto" src={AWS} alt="AWS icon" />
            <p className="my-4">AWS</p>
          </div>
          <div className="skill-icon shadow-md shadow-[#040c16] hover:scale-110 duration-500">
            <img className="w-20 mx-auto" src={GitHub} alt="GitHub icon" />
            <p className="my-4">GitHub</p>
          </div>
          <div className="skill-icon shadow-md shadow-[#040c16] hover:scale-110 duration-500">
            <img className="w-20 mx-auto" src={Tailwind} alt="Tailwind icon" />
            <p className="my-4">Tailwind</p>
          </div>
          <div className="skill-icon shadow-md shadow-[#040c16] hover:scale-110 duration-500">
            <img className="w-20 mx-auto" src={Mongo} alt="MongoDB icon" />
            <p className="my-4">Mongo DB</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Skills;
